package medium;

import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.assertEquals;

class MinimumDeletionsToMakeCharacterFrequenciesUniqueTest {

    MinimumDeletionsToMakeCharacterFrequenciesUnique solution = new MinimumDeletionsToMakeCharacterFrequenciesUnique();

    @Test
    void minDeletions() {
        int actual = solution.minDeletions("aab");
        int expected = 0;
        assertEquals(expected, actual);
    }

    @Test
    void minDeletions2() {
        int actual = solution.minDeletions("aaabbbcc");
        int expected = 2;
        assertEquals(expected, actual);
    }

    @Test
    void minDeletions3() {
        int actual = solution.minDeletions("ceabaacb");
        int expected = 2;
        assertEquals(expected, actual);
    }

    @Test
    void minDeletions4() {
        int actual = solution.minDeletions("");
        int expected = 2;
        assertEquals(expected, actual);
    }
}